ntiene peperoncino (0,6%), sale, paprica, addensanti: gomma di xanthan; colorante alimentare: estratto di paprica. Può contenere tracce di uova e latte.', 'https://static.openfoodfacts.org/images/products/28105381/front_it.4.400.jpg', '14.9', '6.8', '27.7', '11.6', '', '14.4', '1.85', '0.728346456692913', '', '0');

